function Get-Icon {
    param ( 
        [string]$Name
    )
    # Icon-Collection
    $Icons = @{
    "About" = @"
        
"@
    "Choco" = @"
    
"@
    "Default" = @"
    
"@
}
    # Icon aus Base64-String erstellen
    if ($Icons.ContainsKey($Name)) {
        $iconData = $Icons[$Name]
    } else {
        $iconData = $Icons['Default']
    }
    $bytes = [System.Convert]::FromBase64String($iconData)
    $stream = New-Object System.IO.MemoryStream(,$bytes)
    [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::FromStream($stream)).GetHicon())



