# create-Funktionen
function createFont {
    param (
        [string]$FontFamily = $DefaultFont,
        [int]$FontSize      = 12,
        [string]$FontStyle  = "Regular"
    )

    # Mehrere Styles durch Komma getrennt verarbeiten
    $styleFlags = 0
    $FontStyle.Split(',') | ForEach-Object {
        $style = $_.Trim()
        $styleEnum = [System.Drawing.FontStyle]::$style
        $styleFlags = $styleFlags -bor [int]$styleEnum
    }

    return New-Object System.Drawing.Font($FontFamily, $FontSize, [System.Drawing.FontStyle]$styleFlags)
}
function createForm {
    param (
        [hashtable]$config,
        # Größe & Position
        [int]$Width,                                  # Breite des Fensters
        [int]$Height,                                 # Höhe des Fensters
        [int[]]$Padding = 10,                              # Innenabstand (links, oben, rechts, unten)
        [int[]]$Size,                                 # Größe des Fensters (Breite, Höhe)
        
        # Fensterdarstellung
        [string]$StartPosition = 'CenterScreen',      # Startposition (CenterScreen, Manual, WindowsDefaultLocation)
        [string]$Text = "Fenstertitel",               # Fenstertitel
        [string]$BackColor = $AccentColor,            # Hintergrundfarbe (HTML oder Name)
        [string]$FormBorderStyle = 'FixedSingle',     # Rahmenstil (None, FixedSingle, Fixed3D, Sizable, etc.)

        # Fensterverhalten
        [bool]$TopMost = $false,                      # Immer im Vordergrund
        [bool]$ShowIcon = $false,                     # Icon anzeigen
        [string]$Base64,                              # Base64-Icon
        [bool]$MinimizeBox = $false,                  # Minimieren-Schaltfläche
        [bool]$MaximizeBox = $false                   # Maximieren-Schaltfläche
    )


    # Formular erstellen und Eigenschaften setzen
    $form = New-Object System.Windows.Forms.Form
    if ($Size) { $form.ClientSize = New-Object System.Drawing.Size($Size[0], $Size[1]) } 
    if ($Width -and $Height) { $form.ClientSize = New-Object System.Drawing.Size($Width, $Height) }
    if ($Padding) { 
        $PadLeft    = if ($Padding.Length -ge 1) { $Padding[0] } else { 0 }
        $PadTop     = if ($Padding.Length -ge 2) { $Padding[1] } else { $PadLeft }
        $PadRight   = if ($Padding.Length -ge 3) { $Padding[2] } else { $PadLeft }
        $PadBottom  = if ($Padding.Length -ge 4) { $Padding[3] } else { $PadTop }

        $form.Padding = New-Object System.Windows.Forms.Padding($PadLeft, $PadTop, $PadRight, $PadBottom) 
    }
    $form.StartPosition     = $StartPosition
    $form.FormBorderStyle   = $FormBorderStyle
    $form.MinimizeBox       = $MinimizeBox
    $form.MaximizeBox       = $MaximizeBox
    $form.ShowIcon          = $ShowIcon
    $form.Text              = $Text
    $form.TopMost           = $TopMost
    $form.BackColor         = [System.Drawing.ColorTranslator]::FromHtml($BackColor)

    # Base64-Icon
    if ($Base64){
        $form.ShowIcon = $true
        $Bytes = [Convert]::FromBase64String($Base64)   # Byte-Array dekodieren
        $Stream = New-Object System.IO.MemoryStream(,$Bytes) # Stream erzeugen
        $Icon = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::FromStream($Stream)).GetHicon())
        $form.Icon = $Icon
    }

    return $form
}
function createPanel {
    param (
        # Größe
        [int]$Height,                                       # Höhe des Panels
        [int]$Width,                                        # Breite des Panels
        [int[]]$Size,                                       # Größe des Panels (Breite, Höhe)

        # Position
        [int]$Padding,                                      # Innenabstand
        [string]$Location,                                  # Position des Panels (x,y)
        [int]$Left,
        [int]$Top,

        # Darstellung
        [string]$BackColor = $DarkColor,                    # Hintergrundfarbe des Panels
        [string]$FlatStyle = 'Flat',                        # Stil des Panels (Flat, Standard)
        [string]$Anchor = 'Top,Right,Left',                 # Ankerposition des Panels (Top, Left, Right, Bottom)
        [string]$Dock,                                      # Andockverhalten des Panels (Top, Bottom, Left, Right, Fill)
        
        # Verhalten
        [bool]$AutoScroll = $false                          # Automatisches Scrollen
    )

    $panel = New-Object System.Windows.Forms.Panel
    $panel.FlatStyle    = $FlatStyle
    if ( $Dock ) { $panel.Dock = $Dock }
    if ( $Size ) { $panel.Size = New-Object System.Drawing.Size($Size[0], $Size[1]) }
    if ( $Width -and $Height ) { $panel.Size = New-Object System.Drawing.Size($Width, $Height) }
    if ( $Padding) { $panel.Padding = New-Object System.Windows.Forms.Padding($Padding) }
    $panel.Anchor       = $Anchor
    $panel.Location     = New-Object System.Drawing.Point($Left, $Top)
    $panel.BackColor    = [System.Drawing.ColorTranslator]::FromHtml($BackColor)
    $panel.AutoScroll   = $AutoScroll

    return $panel
}
function createLabel {
    param (
        # Größe & Position
        [int]$Width,                            # Breite des Labels
        [int]$Height,                           # Höhe des Labels
        [string]$Location = "10,10",            # Position des Labels (x,y)

        # Text & Schrift
        [string]$Text = 'Label',                # Text des Labels
        [string]$FontFamily = $DefaultFont,     # Schriftart des Labels
        [int]$FontSize = 12,                    # Schriftgröße des Labels
        [string]$FontStyle = 'Regular',         # Schriftstil des Labels (Regular, Bold, Italic)

        # Darstellung
        [bool]$AutoSize = $true,                # Automatische Größe des Labels
        [string]$Anchor = 'Top,Right,Left',     # Ankerposition des Labels (Top, Left, Right, Bottom)
        [string]$ForeColor = $WhiteColor,       # Schriftfarbe des Labels
        [string]$BackColor = $DarkColor,        # Hintergrundfarbe des Labels

        # Verhalten
        [switch]$Hand = $false,                 # Hand-Cursor aktivieren
        [string]$Visible = $true,               # Sichtbarkeit des Labels
        [string]$Description = ''               # Beschreibung des Labels
    )

    $label = New-Object System.Windows.Forms.Label
    $label.Text         = $Text
    $label.AutoSize     = $AutoSize
    $label.Width        = $Width
    $label.Height       = $Height
    $label.Anchor       = $Anchor
    $coords = $Location -split ','  # Location Koordinaten extrahieren
    $label.Location     = New-Object System.Drawing.Point($coords[0], $coords[1])
    $label.Font         = createFont -FontFamily $FontFamily -FontSize $FontSize -FontStyle $FontStyle
    $label.ForeColor    = [System.Drawing.ColorTranslator]::FromHtml($ForeColor)
    $label.BackColor    = [System.Drawing.ColorTranslator]::FromHtml($BackColor)
    $label.Visible      = $Visible

    # Tooltip setzen, falls vorhanden
    if ($Description) {
        $global:LabelToolTip.SetToolTip($label, $Description)
    }

    # Cursor ändern, falls Hand gewünscht
    if ($Hand) { 
        $label.Cursor = [System.Windows.Forms.Cursors]::Hand 
    }

    return $label
}
function createButton {
    param (
        # Position und Größe
        [int]$Width = 200,                          # Breite (Pflichtparameter)
        [int]$Height = 25,                          # Höhe
        [string]$Location,                          # Position im Format "x,y"

        # Text und Schrift
        [string]$Text = 'Button',                   # Button-Text
        [int]$FontSize = 9,                         # Schriftgröße
        [string]$FontFamily = $DefaultFont,         # Schriftart
        [string]$ForeColor = $AccentColor,          # Schriftfarbe (HTML oder Name)

        # Darstellung
        [string]$BackColor = $DarkColor,            # Hintergrundfarbe (HTML oder Name)
        [string]$FlatStyle = 'Flat',                # Stil (Flat, Standard)
        [string]$Dock,                              # Andockverhalten (Top, Bottom, Left, Right, Fill)
        [string]$Cursor = "Default"                 # Mauszeiger ändern (Default, Hand, AppStarting)
    )

    # Extrahiere X- und Y-Koordinaten aus dem Location-String
    
    # Erstelle den Button und setze Eigenschaften
    $button = New-Object System.Windows.Forms.Button
    $button.Text        = $Text
    $button.Width       = $Width
    $button.Height      = $Height
    $button.FlatStyle   = $FlatStyle
    $button.Font        = createFont -FontFamily $FontFamily -FontSize $FontSize # New-Object System.Drawing.Font($FontFamily, $FontSize)
    $button.ForeColor   = [System.Drawing.ColorTranslator]::FromHtml($ForeColor)
    $button.BackColor   = [System.Drawing.ColorTranslator]::FromHtml($BackColor)
    $button.Cursor      = $Cursors::$Cursor
    if ($Location) {
        $coords = $Location -split ','
        $x = [int]$coords[0]
        $y = [int]$coords[1]
        $button.Location    = New-Object System.Drawing.Point($x, $y)
    }
    if ($Dock) { $button.Dock = $Dock }

    return $button

}
function createCheckedListBox {
    param (
        # Größe & Position
        [int]$Width,            # Breite des CheckedListBox
        [int]$Height,           # Höhe des CheckedListBox
        [string]$Location,      # Position des CheckedListBox (x,y)

        # Verhalten
        [bool]$CheckOnClick = $true,    # Aktiviert Checkbox direkt beim Klicken
        
        # Darstellung
        [string]$BackColor = $DarkColor,        # Hintergrundfarbe
        [string]$ForeColor = $WhiteColor,       # Schriftfarbe
        [string]$FontFamily = $DefaultFont,     # Schriftart
        [int]$FontSize = 11,                    # Schriftgröße
        [string]$BorderColor = $AccentColor,    # Rahmenfarbe 
        
        # Zusätzliche Eigenschaften
        [bool]$AutoScroll = $true,              # Ermöglicht vertikales Schrollen
        [string]$FlatStyle = 'Flat',            # Stil des Steuerelements (Flat, Standard)
        [string]$BorderStyle = 'None',          # Rahmenstil (None, FixedSingle, Fixed3D)
        [string]$Anchor = 'Top,Right,Left',     # Verankerung innerhalb des Containers
        [string]$SelectionMode = 'MultiSimple', # Auswahlmodus des Listbox (None, One, MultiSimple, MultiExtended)
        
        [bool]$MultiColumn = $false,    # Mehrere Spalten aktivieren
        [int]$ColumnWidth = 200,        # Breite der Spalten
        [int]$ItemHeight = 20           # Höhe der Listeneinträge
    )

    $checkedListBox = New-Object System.Windows.Forms.CheckedListBox
